import '../../styles/Gallery/Gallery.css'
import Thumb from '../Gallery/Thumb'
import housing from '../../datas/logements.json'
const housingList = JSON.parse(housing);

function Gallery() {
	return (
	<ul className='kasa-housing-list'>
	{housingList.map(({ id, cover, title}) => (
		<Thumb
			id={id}
			cover={cover}
			title={title}
			/>
		))}
	</ul>
	)
}

export default Gallery
